//import SideNav, { Toggle, Nav, NavItem, NavIcon, NavText } from '@trendmicro/react-sidenav';
//import '@trendmicro/react-sidenav/dist/react-sidenav.css';
import React from 'react';
import TableSection from './Table/TableSection';
import {BrowserRouter as Router, Route, Switch} from 'react-router-dom';
import { NavLink } from 'react-router-dom'

class Home extends React.Component {
  render() {

    return (
    <Router>
    <Route render={({location, history}) => (
        <React.Fragment>
            <SideNav onSelect={(selected) => {
                        const to = '/' + selected;
                        if (location.pathname !== to) {
                            history.push(to);
                        }
                    }}>
                <SideNav.Toggle />
                <SideNav.Nav defaultSelected="table">
                    <NavItem eventKey="table">
                        <NavLink to='/home/productsList'>
                            Products List 
                         </NavLink>
                    </NavItem>
                    <NavItem eventKey="table">
                        <NavLink to='/home/shopsList'>
                            Shops List
                        </NavLink>
                    </NavItem>
                    <NavItem eventKey="table">
                        <NavLink to='/home/sendersList'>
                             Senders List
                        </NavLink>
                    </NavItem>

                </SideNav.Nav>
            </SideNav>
            <button>Log Out</button>
            <div>
                <Route path="/home/productsList" exact component={TableSection} />
                <Route path="/home/shopsList" component={<div>Shops List</div>}/>
                <Route path="/home/sendersList" component={<div>Shops List</div>} />
            </div>
        </React.Fragment>
    )}
    />
</Router>

    );
  }
}

export default Home;
